import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import "./App.css";
import Post from "./components/pages/post";

function App() {
  return (
    <div className="App">
      <Router>
        <Route exact path="/post" element={<Post />} />
      </Router>
    </div>
  );
}

export default App;
